	private static final int SERVICIO_REGISTRAR_NOTIFICACION = 3;

	public static ConsultaCuentaResponse consultarCuenta(String cuenta) {
		ConsultaCuentaResponse response = null;
		try {
			log.info("SERVICIO: CONSULTA CUENTA");
			SolicitudServicioBean consultaCuenta = new SolicitudServicioBean();
			ConsultaCuentaRequest consultaCuentaRequest = new ConsultaCuentaRequest();
			String ip = ApplicationParameters.getInstance().getString("core.ip");
			String puerto = ApplicationParameters.getInstance().getString("core.puerto");
			String idServicio = ApplicationParameters.getInstance().getString("servicio.core.consultaCuenta.idServicio");
			String idTransaccion = ApplicationParameters.getInstance().getString("servicio.core.idTransaccion");
			String codigoUsuario = ApplicationParameters.getInstance().getString("servicio.core.codigoUsuario");
			String codigoAgencia = ApplicationParameters.getInstance().getString("servicio.core.codigoAgencia");
			String sistema = ApplicationParameters.getInstance().getString("servicio.core.sistema");
			String programa = ApplicationParameters.getInstance().getString("servicio.core.programa");
			String fechaHora = Utils.getReferencia();
			String localizacionUsuario = Utils.obtenerIpServidor();
			consultaCuenta.setId(idServicio);
			consultaCuenta.setIdTransaccion(idTransaccion);
			consultaCuenta.setUsuario(codigoUsuario);
			consultaCuenta.setAgencia(codigoAgencia);
			consultaCuenta.setSistema(sistema);
			consultaCuenta.setPrograma(programa);
			consultaCuenta.setFechahora(fechaHora);
			consultaCuenta.setLocacionUsuario(localizacionUsuario);
			consultaCuentaRequest.setNumeroCuenta(cuenta);
			String xmlGenerado = generadorXML.generarXML(consultaCuenta, consultaCuentaRequest);
			log.info("REQUEST: " + xmlGenerado);
			String salidaProceso = obtenerSalida(xmlGenerado, ip + ":" + puerto, SERVICIO_OBTENER_CUENTA);
			log.info("RESPONSE: " + salidaProceso);
			System.out.println(xmlGenerado);
			System.out.println(salidaProceso);
			response = XMLDecodificador.decodificarSalidaCuenta(salidaProceso);
		} catch (Exception e) {
			log.error(e);
		}

		return response;
	}
	

